import React, {useEffect} from 'react';
import { View, Text } from 'react-native';
import { useSelector } from 'react-redux';
import { useDispatch } from 'react-redux';
import { allCharacter } from '../../redux/actions/actions';
import Cardd from '../card/card';
export default function Cards() {
    const dispatch = useDispatch();
    useEffect(()=>{
        dispatch(allCharacter())
    },[dispatch])

    const characters = useSelector((state) => state.character.results );
    console.log(characters)

    return (
        <View>
            {
               characters && characters.map(phones => {
                    return (
                        <Cardd 
                        name={phones.name}
                        species={phones.species}
                        image={phones.image}
                        />
                    )
                })
            }
        </View>
    );
}
